import Icon_Youtube from "../img/Icon_Youtube.png";
import Icon_Options from "../img/Icon_Options.png";

export default function Cabecario() {
  return (
    <div className="Cabecario">
      {/*<img src={Icon_Youtube} className="Icon_Youtube" />*/}
      <yt-icon id="logo-icon" className="style-scope ytd-logo">
        {/* <!--css-build:shady--><!--css-build:shady--> */}
        <yt-icon-shape className="style-scope yt-icon">
          <icon-shape className="yt-spec-icon-shape">
            <div
              style={{
                width: "100%",
                height: "100%",
                fill: "currentcolor",
              }}
            >
              <svg
                xmlns="http://www.w3.org/2000/svg"
                className="external-icon"
                viewBox="0 0 97 20"
                style={{
                  width: "100%",
                  pointerEvents: "none",
                  display: "block",
                  height: "100%",
                }}
                focusable="false"
              >
                <svg
                  viewBox="0 0 97 20"
                  preserveAspectRatio="xMidYMid meet"
                  xmlns="http://www.w3.org/2000/svg"
                >
                  {/* Seu conte√∫do SVG */}
                </svg>
              </svg>
            </div>
          </icon-shape>
        </yt-icon-shape>
      </yt-icon>
      <img src={Icon_Options} className="Icon_Options" />
      <button className="Button_Assine_Agora">ASSINE AGORA</button>
    </div>
  );
}
